library rc4;

import 'package:unittest/unittest.dart';
import 'package:range/range.dart';
import '../lib/rc4.dart';
import 'dart:math';

void main() {
  group('Full Test', () {
    const String key = "This is a test";
    const String message = "Attack at dawn!";

    test('General Setup', () {
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "TVwO6ouZIc8d2FjL5lf8");
      expect(decrypted, message);
    });

    test('No-Drop Frame', () {
      RC4 rc4 = new RC4(key, 0);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "4xZ3pgZc9X4BNL5Qj2ND");
      expect(decrypted, message);
    });

    test('Invalid Custom Drop Frame', () {
      try {
        new RC4(key, 255);
        expect(false, true);
      } catch(e) {
        expect(e.toString(), 'Exception: Drop Bytes must be multiple of 256, was <255>.');
      }
    });

    test('Valid Custom Drop Frame', () {
      RC4 rc4 = new RC4(key, 256 * 32);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "2q8OLeHYdNhX31pJruWB");
      expect(decrypted, message);
    });

    test('Random (fixed seed) key/message', () {
      Random r = new Random(123456);
      var randomString = (int length) => new String.fromCharCodes(range(length).map((i) => r.nextInt(256)));
      var key = randomString(16);
      var message = randomString(128);
      expect(key, 'OGº°U¬·ElÆ<');
      expect(message, '«øhgî«"C%\tûS-±Hä;ÕÁn ìí\rcõ0ÒsãLãL1\rRaMÆÝ Õ.×\$Öp#Kæ¦S´S,ÝÞúöõïòÔ«tqWN.c~o¬P¢1²8BÙVËwxL}J0');

      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "5zYeGHXgtYqdhe2tQFDtbCExLeRznmhxAjTFBsMhprobKLmAEs8d8Q4GpWGGNmbNKYOm5BVhLlnTju1JKTNC6qVVNbuKuvmnEtrkcf2gzxpMCz4ZIZTiNZ4FnuX1_V4yTvBqppQgCoZZ57Qmd2qaSVgwmzt7Jmsrgrrtmx6A4gU=");
      expect(decrypted, message);
    });

    test('Long Message', () {
      String longMessage = '';
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);

      expect(decrypted, message);
    });

    test("Foo",(){
      var message = '{"id":"feddb137","topic":"store","data":"{\"response\":\"asset\",\"asset\":{\"id\":\"52c6eb4b626a7c9175c7c1b7\",\"name\":\"Grass\",\"description\":\"Light grass best for X games.\",\"thumbnail\":\"\"}}"}';
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(decrypted, message);
    });
  });
}